import { Table, Menu, Dropdown, Button, Collapse } from "antd";
const { Panel } = Collapse;

const columns = [
  {
    title: 'Padrao',
    dataIndex: 'padrao',
    key: 'padrao',
  },
  {
    title: 'F/mm',
    dataIndex: 'fmm',
    key: 'fmm',
  },
  {
    title: 'Unidades',
    dataIndex: 'unidades',
    key: 'unidades',
  },
  {
    title: 'Fim da Protecao de Molde',
    dataIndex: 'fimProtecaoMolde',
    key: 'fimProtecaoMolde',
    children: [
      {
        title: 'Forca',
        dataIndex: 'forca1',
        key: 'forca1',
      },
      {
        title: 'Ponto',
        dataIndex: 'ponto1',
        key: 'ponto1',
      },
    ],
  },
  {
    title: 'Pressao de Protecao de Molde',
    dataIndex: 'pressaoProtecaoMolde',
    key: 'pressaoProtecaoMolde',
    children: [
      {
        title: 'Forca',
        dataIndex: 'forca2',
        key: 'forca2',
      },
      {
        title: 'Ponto',
        dataIndex: 'ponto2',
        key: 'ponto2',
      },
    ],
  },
];

const data = [
  {
    key: '1',
    padrao: 'Padrao',
    fmm: '',
    unidades: '',
    forca1: 'Fim da Protecao de Molde',
    ponto1: '',
    forca2: 'Pressao de Protecao de Molde',
    ponto2: '',
  },
  {
    key: '2',
    padrao: '',
    fmm: 'F/mm',
    unidades: 'Unidades',
    forca1: 'Forca',
    ponto1: 'Ponto',
    forca2: 'Forca',
    ponto2: 'Ponto',
  },
  {
    key: '3',
    padrao: '',
    fmm: '',
    unidades: '',
    forca1: '900',
    ponto1: '0.5',
    forca2: '14',
    ponto2: '55',
  },
];

const ExampleTable = () => {
  return <Table columns={columns} dataSource={data} />;
};

export default App;
